import React from "react";

const ROUTES = {
    AUTH: '/auth',
    ADMIN: '/admin',
}

const API_ROUTES = {
    AUTH_STATUS: '/api/auth/auth-status',
    AUTH_LOGIN: '/api/auth/auth-login'
}

const AWS = {
    API_NAME: 'cutoverplan-api'
}


const ENUMS = {
    ROUTES,
    API_ROUTES,
    AWS
}

export default ENUMS;
